  const backgounrdChange = () =>{
    let newBackground = <video src='/videos/main2.mp4' autoPlay loop muted />
    setBackground(newBackground);
  }

  const [background, setBackground] = useState(<video className="first" onClick={backgounrdChange} src='/videos/main.mp4' autoPlay loop muted />);


  return(
  <div className={home.wrap}>
      <Navbar className={'mainPage'}/>
      <Main></Main>
      <Video></Video>
      {/* <Button className="position">click me</Button> */}
  </div>
);
};


